import axios from 'axios';

export async function getCalendar() {
  const res = await axios.get('https://www.google.com/auth/calendar', {
    headers: {
      "key": "AIzaSyA01kqSYr0sYcI2xCC7f6NlfX4R6pFgwWA"
    }
  });
  return res.data;
};
